import React from 'react';
import Loader from '../Components/Loader';
import ProductCard from '../Components/ProductCard';
import { useAxiosGet } from '../Hooks/httpRequests';

function Home() {
  const url = `https://api.coingecko.com/api/v3/simple/price?ids=bitcoin%2Cethereum&vs_currencies=usd&include_market_cap=true&include_24hr_vol=true&include_24hr_change=true&include_last_updated_at=true`;

  let products = useAxiosGet(url);
  console.log(products.data);

  let content = null;

  if (products.error) {
    content = (
      <div>
        <div className="bg-red-300 p-3">
          There was an error please refresh or try again later.
        </div>
      </div>
    );
  }

  if (products.loading) {
    content = <Loader></Loader>;
  }

  if (products.data) {
    console.log(products.data);
    content = Object.values(products.data).map((item, key) => (
      <div>{<ProductCard product={item} name={key} />}</div>
    ));
  }

  return <div className="grid grid-cols-6">{content}</div>;
}

export default Home;
